import { React } from "react";
import { Header, Footer, Drawer } from "../../components/HomePage";
import { MovieGridView, MovieView } from "../../components/MoviesPage";
import "./styles.css";

const Movies = () => {
  return (
    <>
      <Header />
      <Drawer />
      <MovieGridView />
      <Footer />
    </>
  );
};

export default Movies;
